  selector: 'app-book',
  templateUrl: './book.component.html',
  styleUrls: ['./book.component.css']
})
export class BookComponent {

  constructor(private router: Router){}

  navigateToBookCreate(): void {
    this.router.navigate(['/book/new'])
  }
